import React from "react";
import Button from "./Button.js";
import "./Landing.css";

const Landing = () => {
  return (
    <div className="LandingBox">
      <div className="boxButton">
        <Button />
      </div>
      <div className="boxDataLandig"></div>
    </div>
  );
};

export default Landing;
